import React from 'react'

const TextBlock = ( {content, style, title }) => {
  return (
    <div className={style}>
        <Sub title={title}/>
      {content}
    </div>
  )
}

export default TextBlock

function Sub(){
    return (
        <div className="sub">
            <h2 className='font-black text-4xl pb-8'></h2>
        </div>
    )
}
